import React from "react";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import { connect } from "react-redux";
import { actionTypes } from "../../store/actions";
const Form = () => {
  return (
    <div>
      <form>
        <TextField></TextField>
        <Button onClick={this.props.onStoreResult()} style={{ color: "black" }}>
          送信
        </Button>
      </form>
      <ul>
        {this.props.add.map((l) => (
          <li key={l.id}>{l.value}</li>
        ))}
      </ul>
    </div>
  );
};
const mapStateToProps = (state) => {
  return {
    add: state.add.todo
  };
};

const mapDisptchToProps = (dispatch) => {
  return {
    onStoreResult: () => dispatch(actionTypes.ADD),
    onDeleteResult: () => dispatch(actionTypes.REMOVE)
  };
};

export default connect(mapStateToProps, mapDisptchToProps)(Form);
